#include <iostream>
#include <vector>
using namespace std;

class Solution {
public:
    int maxSum(vector<int>& nums1, vector<int>& nums2) {
        int sum = 0;
        int len1 = nums1.size();
        int len2 = nums2.size();

        vector<vector<int>> join;
        int i = 0;
        int j = 0;
        while (i < len1 && j < len2) {
            if (nums1[i] == nums2[j]) {
                join.push_back({ i, j });
                i++;
                j++;
            }
            else if (nums1[i] < nums2[j]) {
                i++;
            }
            else {
                j++;
            }
        }

        join.push_back({ len1, len2 } );
        
        int start1 = 0;
        int start2 = 0;
        for (int k = 0; k < join.size(); k++) {
            long long sum1 = countSum(nums1, start1, join[k][0]);
            long long sum2 = countSum(nums2, start2, join[k][1]);
            start1 = join[k][0];
            start2 = join[k][1];
            sum += max(sum1, sum2);
        }

        return sum % (1000000007);
    }

    long long countSum(vector<int>& nums, int start, int end) {
        long long sum = 0;
        for (int i = start; i < end; i++) {
            sum += nums[i];
        }
        return sum;
    }
};

